import React from 'react'
import "./VideoDescription.scss";

export default function VideoDescription(props) {
    return (
        <div>
            <div className="video-description">
                <p>{props.description}</p>
            </div>
            <div>
                <h1 className="video-title">{props.title}</h1>
            </div>
        </div>
    )
}
